function eventHandlers(){document.querySelector("#mailing_list").addEventListener("submit",emailSignup)}function emailSignup(e){e.preventDefault();var t=new XMLHttpRequest,n=new FormData(document.querySelector("#mailing_list"));t.addEventListener("load",requestSuccess),t.addEventListener("error",requestError),t.addEventListener("abort",requestAborted),t.open("POST","/mailing_list"),t.setRequestHeader("X-CSRFToken",getCookie("csrftoken")),t.setRequestHeader("X-Requested-With","XMLHttpRequest"),t.send(n)}function getCookie(e){var t=null;if(document.cookie&&""!==document.cookie)for(var n=document.cookie.split(";"),o=0;o<n.length;o++){var r=n[o].trim();if(r.substring(0,e.length+1)===e+"="){t=decodeURIComponent(r.substring(e.length+1));break}}return t}function loadEnded(e){console.log(e)}function requestSuccess(){console.log(this.responseText);var e=JSON.parse(this.responseText);console.log("response: ",e)}function requestError(){console.log("error: ",this)}function requestAborted(){console.log("aborted: ",this)}window.addEventListener("load",function(e){eventHandlers(),window.setTimeout(function(){console.log("loaded")},250)});